// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./Leilao.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
contract FabricaLeilao is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private LeilaoId;
    Leilao[] public Contratos;
    DadosLeilao[] public Leiloes;
    uint private leloesCount;
    struct DadosLeilao {
        uint Id ;
        string urlToken;
        bool Iniciado;
        uint MaiorLance;
        address DonoMaiorLance;
    }
    
    
    function novoLeilao( address  mintier) onlyOwner public  
    {
        Leilao contrato= new Leilao()
        ;
        contrato.addMinter(mintier);
        Contratos.push(contrato);
        uint length = Contratos.length -1;
        Leiloes[length ].Id = length;
        Leiloes[length].urlToken = "";
        Leiloes[length].MaiorLance =0;

        Leiloes[length].DonoMaiorLance = mintier;
        
    }
    function iniciaLeilao(uint startingBid, string memory nftUrl,uint newItemId ) public {
        //require(Contratos[newItemId ].isMintedr(), "Voce nao tem privilegios para executar essa acao");
        Contratos[newItemId].start(startingBid );
        Leiloes[newItemId].Iniciado = true;
        Leiloes[newItemId].urlToken = nftUrl;


    }
    function encerrarLeilao(uint leilaoId) public {
        require(Leiloes[leilaoId].Iniciado == true,"Leilao nao iniciado");
        //require(Contratos[leilaoId ].isMintedr(), "Voce nao tem privilegios para executar essa acao");
        Contratos[leilaoId].end();
        Leiloes[leilaoId].Iniciado = false;
    }
    function darLance(uint leilaoId) external payable {
        address bidder;
         uint bidValue;
        
        Contratos[leilaoId].bid();
        ( bidder, bidValue) = Contratos[leilaoId].getHighest();
        Leiloes[leilaoId].MaiorLance = bidValue;
        Leiloes[leilaoId].DonoMaiorLance =  bidder;
        
    }
    function sacar(uint leilaoId)  external payable {
        Contratos[leilaoId].widthdraw();
    }
    function listarLances() public view returns(DadosLeilao[] memory) {
        return Leiloes;
    }
}
